      "\"object\": \"tag\", \"object_id\": \"moscow\", \"time\": 1450979289, " +
      "\"subscription_id\": 21371989, \"data\": {}}]".replace("{}", "\" \"")

    SubscriptionParserActor.forAllJsonArrayElements(message,
